import React from 'react';
import { Route } from 'react-router-dom';
import { Header, login } from 'components';

class App extends React.Component {
    render(){

        return (
            <div>
                <Route exact path="/" component={Home}/>
                <Route path="/login" component={Login}/>
                <Header/>
                { this.props.children }
            </div>
        );
    }
}

export default App;
